Tempat ziarah lokasi penembakan Mgr. Yohanes Arts MSC dkk. 	Halo guys, nah diakhir pekan ini kita mau berkujung ke arah timur nih, tepatnya di Maluku Tenggara. Disini ada sebuah tempat ziarah yang tidak boleh dilewatkan oleh kalian nih, kenapa ?? karena tempat ini merupakan tempat bersejarah pada zaman penjajahan bangsa Jepang. Pada tanggal 30 Juli 1942, tentara Jepang tiba di daerah Langgur, Maluku Tenggara dan berusaha mengusir orang-orang yang bukan pribumi. Kemudian mereka menangkap uskup Mgr Yohanes Arts MSC dan  para misionaris asing lainnya dan ingin mengeksekusi mereka. Namun mereka tidak gentar, dengan keyakinan teguh akan Yesus Kristus mereka berseru “ Untuk Kristus Raja Kita, Jadilah !!!” setalah itu mereka kemudian gugur setelah ditembak di pantai desa Langgur. Nah dari cerita dramatis itu, sekarang ditempat inilah sudah jadikan taman ziarah untuk mengenang para misionaris yang rela mati demi Kristus. Pada tahun ini, tanggal 31 Juli 2017 akan diadakan perayaan besar untuk mengenang 75 tahun para Martir di desa Langgur, Maluku Tenggara. Yuk guys yang penasaran dan ingin merasakan suasananya secara langsung. Selamat berakhir pekan  
